  if(setTimeout(500)){
    setItem([
      {
        name:"irfan"
      },{
        name:"imran"
      }
    ])
  }
  return (
    <div>
        <Navbar/>
        <Slider/>
        {item&&item.map(()=>{

        })}
    </div>
  )
}
